import React from "react";
import ReactDOM from "react-dom";
import Main from "./Main.js"
import Pantry from "./Pantry.js"

function App(){
  return (
    <main>
      <Switch>
        <Route path='/' component ={Main} exact/>
        <Route path='/mypantry' component={Pantry}/>
        <Route component={Error}/>
      </Switch>
    </main>
  )
}
